import React from 'react';
import {Link} from 'react-router'
import {Navbar, NavItem} from 'react-materialize';

export default React.createClass({
  render(){
    return (
    <div>
      <Navbar brand='logo' right>
        <NavItem>Home</NavItem>
        <NavItem>Register</NavItem>
      </Navbar>
      {this.props.children}
    </div>
    )
  }
})
